import React, { Component } from 'react'

export default class SignIn extends Component {
    render() {
        return (
            <div>
                <Login/>
                <Dashboard/>
            </div>
        )
    }
}

const Login = () => {
    return (
        <div>
            <button>Login</button>
        </div>
    )
}

const Dashboard = () => {
    return (
        <div>
            <h1>Dashboard</h1>
            <button>Logout</button>
        </div>
    )
}
